	*public* ListAdapter(List&lt;T&gt; list) {
		*this*.list = *new* ArrayList&lt;T&gt;();
		*for*(T *con*: list) {
			*this*.list.add(con);
		}
	}

	*public* *void* push(T arg) {
		list.add(arg);
	}

	*public* T pop() {
		T *pop* = *null*;
		*if*(list.size()!=0) {
