教科書12ページ 2.3節　オブジェクトの生成・参照　をよく読んでください。[SEP]別の回答者です．他クラスということを強調すると委譲と呼ばれています．該当する章を呼んでもらったらいいかと思います．
フィールドで他のクラスAの参照型変数をクラスBは持っています．
その初期化方法は，コンストラクタ内で自分でnewする，RectangleのxPositionのようにコンストラクタの引数からもらってくる．セッターで定義する
があります．
使用方法として，フィールドに対して，メソッド呼び出しをすればいいです．また，メソッドdoHoge()のようにフィールドは使わずにメソッドの引数のオブジェクトを使う．
というのもあります．

public class A {
   public void hoge();
}

public class B {
   private A a;
   private A a1;
   private A a2;
   public B(A a) {
       a1 = new A();

       a2 = a;
   }
    public void setA(A a) {
       this.a = a;
    }
    public void doHoge(A a3) {
        a3.hoge();
   }
   public void hogehoge()  {
       a. hoge();
       a1.hoge();
       a2.hoge();
   }
}

public class Main {
  public static void main(String[] args) {
     A a = new A();
     B b = new B(a);
    b.doHoge(a);
    b.setA(a);
    b.hogehoge();
  }
}[SEP]教科書の該当する章を読んでみることにします。ありがとうございました。

