A: スコープの範囲内 B: スコープの範囲外
問の一部
【例題 3-1-01】09 行目の a
【例題 3-1-02】10 行目の b

解答の一部
【例題 3-1-01】A
【例題 3-1-02】B

例題 3-1-01は，09 行目の a，つまりSystem.out.println(a) のa が何らかの変数宣言の有効範囲(教科書では*変数のスコープ*と記*載*)に入っているかどうかを問われています．このa は 002行目の private int a; で宣言された a の範囲内なので A となります．002の a はフィールド変数であり，その有効範囲はクラス全体に及びます．従って，009行目のa もその範囲内にあることになります．

例題 3-1-02は，10 行目の b，つまりSystem.out.println(b)のbについて同様のことを問われているのですが，これに対応する変数宣言がありません．004行目に public ScopeSample(int b) としてbの変数宣言があるのですが，これはメソッドScopeSampleの中でのみ有効な局所変数（教科書では*ローカル変数*と記載)ですので，その有効範囲は004〜006行であり，10行目のbはその範囲外になります．従って答えはBとなります．
その他の問題も同様に考えて下さい．

