こういう時は、自分で色々確かめてみるのが近道です。
```import java.util.Scanner;

public class ScannerTest {
	public static void main(String[] args) {
		Scanner scanner = new Scanner(<http://System.in|System.in>);
		System.out.print("整数を入力してください");

		if (scanner.hasNextInt()) {
			System.out.println("Input OK");
			System.out.println(scanner.nextInt());
			System.out.println(scanner.hasNextInt());
		}
		else {
			System.out.println(scanner.hasNextInt());
			System.out.println(scanner.next());
			System.out.println(scanner.hasNextInt());
		}
	}
}```
上記プログラムで、
```1 1
1 0.1
0.1 1
0.1 0.1```
とそれぞれ入力して、動作の違いを見てください。
その後、15行目の
```System.out.println(scanner.next());```
をコメントアウトしてみて再度
```0.1 1```
と入力し、動作を「推定」してください。

工学においては、答えをすぐに得られることは少なく、色々パラメータをいじってみて、動作を推測することも重要なスキルです。
少しでも参考になれば幸いです（多田が回答していますので、疑問点があれば明日の基礎ゼミで）。念のための補足ですが、Scannerクラスでは区切り文字（半角スペース，改行など）までの入力内容を読み取ります（デフォルト動作の場合）。そのため、「1 0.1」と入力した場合は、1が最初に読み取られ（入力ストリームから情報が読みだされ、入力ストリームからはその情報が消される）、その後0.1が読み取り対象となります（hasNextなんちゃらやnextなんちゃらメソッドの対象となる）。[SEP]わかりました！確かめてみます。ありがとうございます

